import React from "react";

export default class Homepage extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            posts: [
                {
                    title: "Post 1",
                    text: 'Text 1'
                },
                {
                    title: "Post 2",
                    text: 'Text 2'
                },
                {
                    title: "Post 3",
                    text: 'Text 3'
                },
                {
                    title: "Post 4",
                    text: 'Text 4'
                }
            ]
        }
    }
}
